import React, { useState, useEffect } from 'react';
import axios from 'axios'

const Keranjang = ({jumlahPesan}) => {

	const [keranjangPesanan, setKeranjangPesanan] = useState()

	useEffect(() => {
		axios
			.get("http://localhost:3004/keranjangs")
			.then((response) => {
				// handle success
				console.log(response)
			})
			.catch((error) => {
				// handle error
				console.log(error);
			});
	}, [])

	return (
		<div className="container-keranjang">

		</div>
	)
};

export default Keranjang;
